import React from "react";
import { DataWeather } from "../interface/data";

const parsingData = (data: any): DataWeather => {
  console.log(data.location);
  return {
    name: "string",
    region: "string",
    country: "string",
    humidity: 12,
    tempC: 12,
    tempF: 12,
  };
};

export default parsingData;
